"use strict"

function sortM<T>(arr: T[]):T[]{
  let i = arr.length - 1
  let temp
  while (i > 0) {
    for (let j = 0; j < i; j++) {
      if (arr[j] > arr[j + 1]) {
        temp = arr[j]
        arr[j] = arr[j + 1]
        arr[j + 1] = temp
      }
    }
    i--
  }
  return arr
}
function sortK<T>(arr: T[]):T[] {
  if (arr.length <= 1) { return arr }
  let tag = arr[Math.floor(arr.length / 2)]
  let leftArr = []
  let rightArr = []
  arr.splice(Math.floor(arr.length / 2), 1)
  for (let i = 0; i < arr.length - 1; i++) {
    if (tag > arr[i]) {
      leftArr.push(arr[i])
    } else {
      rightArr.push(arr[i])
    }
  }
  return sortK(leftArr).concat(tag, sortK(rightArr))
}
function sortC<T>(arr: T[]):T[] {
  for(let j = 1; j < arr.length; j++) {
    let key = arr[j]
    let orderlyNum = j - 1 // 有序数组下标最大值即为key值前一项
    while (arr[orderlyNum] > key && orderlyNum > -1) {
      arr[orderlyNum + 1] = arr[orderlyNum]
      orderlyNum--
    }
    arr[orderlyNum + 1] = key //  此步是用于完全有序的数组
  }
  return arr
}
// 多种组合的括号是否为有效的括号
function mulValidBrackets(s: string) :boolean {
  let result = []
  let temp = s.split('')
  if (temp.length % 2 === 1) { return false }
  for(let i = 0; i < temp.length; i++) {
    if (temp[i] === '(' || temp[i] === '{' || temp[i] === '[') {
      result.push(temp[i])
    }  else if ((result[result.length - 1] === '[' && temp[i] === ']') || 
    (result[result.length - 1] === '{' && temp[i] === '}') || 
    (result[result.length - 1] === '(' && temp[i] === ')')) {
      result.pop()
    } else {
      return false
    }
  } 
  return result.length === 0
}

interface obj1 {
  label: string,
  status: boolean
}

function testFn(temp: obj1):void {
  console.log(1)
}
function testFnn(temp: {label: string, status: boolean}):void {
  console.log(2)
}

class Animal {
  name: string;
  constructor(trulyName: string) { this.name = trulyName }
  move(moveMeter: number = 0) :void {
    console.log(this.name, 'animal move,', moveMeter)
  }
}

interface Obj3 {
  mainFn(): string
}

class Pot implements Obj3 {
  constructor(private name: string) {}
  mainFn() {
    console.log(111, this.name)
    return '2'
  }
}
class Bot implements Obj3 {
  constructor(private year: string) {}
  mainFn() {
    console.log(222, this.year)
    return '1'
  }
}

let temp: Obj3 = new Bot('a')

if (temp instanceof Bot) {
  console.log(1, temp.mainFn())
}

